import ezdxf
import numpy as np
SCALE_FACTOR = 5.5  # Adjust scale factor here

ORIGIN = (373.76717281343537, 426.525922482613)  # centroid of drawing

def scale_point(pt, factor=SCALE_FACTOR, origin=ORIGIN):
    return (origin[0] + (pt[0]-origin[0])*factor, origin[1] + (pt[1]-origin[1])*factor)

def scale_points(pts, factor=SCALE_FACTOR, origin=ORIGIN):
    return [scale_point(p, factor, origin) for p in pts]

